import React from "react";
import { makeStyles, Grid, Paper, Typography, Button } from "@material-ui/core";
import { grey } from "@material-ui/core/colors";

const useStyles = makeStyles(theme => ({
  container: {
    flexGrow: 1,
    height: "660px",
    textAlign: "center",
    background: grey[400]
  },
  text: {
    color: "white",
    padding: "0 auto",
    margin: "0"
  },
  paper: {
    margin: theme.spacing(2),
    padding: theme.spacing(1),
    textAlign: "center"
  },
  btnCancel: {
    color: "white",
    background: "yellow",
    height: 100,
    width: 200
  }
}));

const BodyOrderChoiceList = () => {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <Grid container>
        <Grid item xs={12} style={{ background: "grey", height: 20 }}></Grid>
        {/* 왼쪽 상태정보 */}
        <Grid item xs={9} style={{ height: 640 }}></Grid>
        {/* 오른쪽 결제확인 */}
        <Grid item xs={3} style={{ height: 640 }}>
          <Typography>주문수량</Typography>
          <Paper className={classes.paper}>0</Paper>
          <Typography>주문금액</Typography>
          <Paper className={classes.paper}>0</Paper>
          <div>
            <Button className={classes.btnCancel}>전체취소</Button>
          </div>
          <Button>결제하기</Button>
        </Grid>
      </Grid>
    </div>
  );
};

export default BodyOrderChoiceList;
